import React from 'react';
import reportWebVitals from './reportWebVitals';
import './index.css';
import store from './redux/State';
import ReactDOM from 'react-dom';
import App from './App';
import { BrowserRouter } from 'react-router-dom';

let renderEntireTree = (state) => {

    ReactDOM.render(

        <BrowserRouter>
            <App state={store._state} addPost={store.addPost} updateNewPostText={store.updateNewPostText} addMessage={store.addMessage} updateNewMessageText={store.updateNewMessageText} />
        </BrowserRouter>,

        document.getElementById('root')
    );

}

renderEntireTree(store._state);
subscribe(store.renderEntireTree);




// If you want to start measuring performance in your app, pass a function
